class TrieNode:
    def __init__(self, val):
        self.val = val
        self.children = {}
        self.isWord = False

class Solution(object):
    def addWord(self, root, word):
        if not word:
            root.isWord = True
            return None

        nextChar = word[0]
        if nextChar in root.children:
            self.addWord(root.children[nextChar], word[1::])
        else:
            child = TrieNode(val=nextChar)
            root.children[nextChar] = child
            if len(word) > 1:
                self.addWord(root.children[nextChar], word[1::])
            else:
                child.isWord = True

    def findWordGreedy(self, root, word):
        currNode = root
        idx = 0
        for i in range(1, len(word)):
            if currNode.isWord:
                idx = i

            if word[i] not in currNode.children:
                return idx

            currNode = currNode.children[word[i]]

        if currNode.isWord:
            idx = len(word)

        return idx

    def searchGreedy(self, trieRoot, w):
        foundIdx = self.findWordGreedy(trieRoot.children[w[0]], w)
        subIdx = foundIdx
        subWord = w[foundIdx:len(w)]
        while subIdx != 0 and subWord:
            if w[foundIdx] in trieRoot.children:
                subIdx = self.findWordGreedy(trieRoot.children[w[foundIdx]], subWord)
                foundIdx += subIdx
                subWord = subWord[subIdx:len(subWord)]
            else:
                break
        if not subWord:
            return True
        return False

    def findWord(self, root, currNode, word):
        if not word:
            if currNode.isWord:
                return True
            return False

        b1 = False
        if word[0] in currNode.children:
            b1 = self.findWord(root, currNode.children[word[0]], word[1::])

        b2 = False
        if currNode.isWord and not b1:
            b2 = self.findWord(root, root, word)

        return b1 | b2

    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """
        if len(words) == 1:
            return []

        if '' in words:
            words.remove('')

        wordsSet = []
        for i in words:
            if i not in wordsSet:
                wordsSet.append(i)
        sortedWords = sorted(wordsSet, key = lambda x : len(x))
        trieRoot = TrieNode('')

        concatWord = []
        for w in sortedWords:
            if w[0] in trieRoot.children:
                greedyFound = self.searchGreedy(trieRoot, w)
                if greedyFound:
                    concatWord.append(w)
                else:
                    if self.findWord(trieRoot, trieRoot, w):
                        concatWord.append(w)
            self.addWord(trieRoot, w)

        return concatWord

